pragma solidity ^0.4.18;

//noinspection ALL
contract MeTooVault {

	struct Memory {
		uint timestamp;
		string memoryString;
	}

    uint _numberOfMemories;

	mapping (address => Memory[]) _memories;

	function MeTooVault() {
	    _numberOfMemories = 0;
	}

	function embedMemory(string memoryString) returns (int result) {
        if (bytes(memoryString).length > 10000) {
			result = -2;
		} else {
		    Memory memory _memory;
            _memory.timestamp = now;
            _memory.memoryString = memoryString;
            _memories[msg.sender].push(_memory);
			_numberOfMemories+=1;
			result = 0;
		}
	}

	function getLatestMemory() constant returns (string memoryString, uint timestamp) {

		if (_memories[msg.sender].length > 0){
		    return (_memories[msg.sender][0].memoryString, _memories[msg.sender][0].timestamp);
		}
		else
		{
		    return ("none", 0);
		}
	}

	function getNumberOfMemories() constant returns (uint numberOfMemories) {
		return _numberOfMemories;
	}

}
